import React, { Component } from 'react';
import "./landingPage.css";

class LandingPage extends Component {

  render() {
    return (
      <div>
        <h1>Bienvenido a Henry Dogs</h1>
        <img src="https://c4.wallpaperflare.com/wallpaper/26/58/362/animales-corre-hierba-perro-wallpaper-preview.jpg" alt="Landing Page Image" />
        <button onClick={this.handleEnterClick}>Ingresar</button>
      </div>
    );
  }
}

export default (LandingPage);
